      <li>Клиентоориентированность - мы ставим потребности наших клиентов на первое место и стремимся обеспечить им наилучший опыт работы с нами.</li>
    </ul>
    
    <h1>Контакты</h1>
    <p>Если у вас возникли вопросы или вам нужна дополнительная информация, пожалуйста, свяжитесь с нами по следующим контактам:</p>
    <ul>
      <li>Телефон: +7 909 590-22-77</li>
      <li>Email: etalontransspb@mail.ru</li>
    </ul>
  </div>
